import http from 'k6/http';
import { check, sleep } from 'k6';

export const options = {
  vus: 20, 						// number of simultaneous users
  duration: '20s',	 				// test duration
};

export default function () {
  const params = {
    headers: {
      'Content-Type': 'application/json',
    },
  };
/********************Login test************************/
  const login_url = 'http://localhost:5000/api/login';
  const login_payload = JSON.stringify({
    username: 'test',
    password: 'test',
  });
  const login_res = http.post(login_url, login_payload, params);
  check(login_res, {
    'status is 201': (r) => r.status === 201,
  });
/********************Create invoice test***************/
  const invoice_url = 'http://localhost:5000/api/createInvoice';
  const invoice_payload = JSON.stringify({
    username: 'test',
    number: 100,
    date: '2025-31-05',
    pharmacy: 'Farmacia Central',
    medicine: 'Omeprazol Tabletas 20mg',
    quantity: 1,
    image: 'data:image/png;base64,',
    state: 'Pendiente',
  });
  const invoice_res = http.post(invoice_url, invoice_payload, params);
  check(invoice_res, {
    'status is 201': (r) => r.status === 201,
  });
  sleep(1);
}
